import React, { Component } from 'react';
import Background from './stars.jpg';

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { Background } + ")"
};


class Karsilama extends Component {
    render() {
        return (
            <div >
   <section style={ sectionStyle }>
      </section>
</div>
        )
    }
}
export default Karsilama;
